import { Button, Container, Row, Col } from "react-bootstrap";

function App() {
  const person = [{id:'1', name:'احمد', date: '5 مساءا', img:'pain.jpg'},
  {id:'2', name:'محمد', date:'7 ليلا', img:'pain.jpg'},
  {id:'3', name:'يونس', date:'5 مساءا', img:'pain.jpg'},
  {id:'4', name:'رياض', date:'7 مساءا', img:'pain.jpg'},
  {id:'5', name:'ههههه', date:'8 مساءا', img:'pain.jpg'},
  {id:'6', name:'سليمان', date:'9 مساءا', img:'pain.jpg'},
  {id:'7', name:'فلاجح', date:'10 مساءا', img:'pain.jpg'},

]
  return (
    <div className="font color-body">
      <Container className="py-5">
        <Row className="justify-content-center">
          <Col sm="8"  > 
            لديك {person.length}  مواعيد اليوم 
          </Col>
        </Row>
        <Row className="justify-content-center my-2">
          <Col sm="8"  >
               <div className="rectangle p-2">
                {person.length ? (person.map( (item) => {
                   return (
                    <div className="d-flex border-bottom mx-3 my-2">
                    <img className="img-avatar"  src="pain.jpg" alt="image" />
                    <div className="px-3 ">
                     <p className="d-inline fs-5 ">{item.name}</p>
                     <p className=" fs-6 ">{item.date} </p>
                    </div>
                 </div>
                  )
                })): <h2>There is nothing</h2>}
               </div>
          </Col>
        </Row>

        <Row className="justify-content-center my-2">
          <Col sm="8"  className="d-flex justify-content-between" >
             <button className="btn-style p-2">مسح الكل</button>
             <button className="btn-style p-2">عرض البيانات</button>
          </Col>
        </Row>


      </Container>

    </div>
  );
}

export default App;
